import 'package:flutter_test/flutter_test.dart';import 'package:zen_player/utils/util.dart';void main() {  group("AppUtility.isUrl", () {    test("Full URL with protocol", () {      expect(AppUtility.isUrl("http://www.zenplayer.com"), true);    });    test("Full URL without protocol", () {      expect(AppUtility.isUrl("www.zenplayer.com"), true);    });    test("URL without subdomain", () {      expect(AppUtility.isUrl("zenplayer.com"), true);    });    test("URL with path", () {      expect(AppUtility.isUrl("zenplayer.com/videos/player"), true);    });    test("Not a url", () {      expect(AppUtility.isUrl("zen palyer"), false);    });  });}